import React from 'react';
import { Paper, Typography, Grid } from '@mui/material';

const LeagueGoals = ({ data }) => {
  const sortedLeagues = Object.entries(data).sort((a, b) => b[1] - a[1]);

  return (
    <Paper style={{ padding: '20px', backgroundColor: 'rgba(0, 0, 0, 0.5)' }}>
      <Typography variant="h5" gutterBottom style={{ color: '#1E90FF' }}>
        Goles por Liga
      </Typography>
      <Grid container spacing={1}>
        {sortedLeagues.map(([league, goals]) => (
          <Grid item xs={6} key={league}>
            <Typography variant="body2" style={{ color: '#FFFFFF' }}>
              {league}
            </Typography>
            <Typography variant="body1" style={{ color: '#4682B4' }}>
              {goals} goles
            </Typography>
          </Grid>
        ))}
      </Grid>
    </Paper>
  );
};

export default LeagueGoals;
